  Sediment Data Collected During U.S. Geological Survey (USGS) Cruise R/V RAFAEL 07034
  in the Vicinity of Woods Hole, Offshore Massachusetts (RAFA07034_SEDIMENT.SHP)\",\n\t\"tracking_summary\":
